import React from 'react';
import ReactDOM from 'react-dom';

import './App.css';
import "./sidebar.css";
import SideBar from "./sidebar";
import logo from './assets/fusion_logo.png';
import styles from './styles.scss'
import RecipeCard from '../node_modules/react-ui-cards';


function App() {
    return (
        <div id="App">

            <SideBar pageWrapId={"page-wrap"} outerContainerId={"App"} />



            <div id="page-wrap">
                <h1>conFUSION</h1>
            </div>
        <h2>
        Recipe Cards
    </h2>
    <div className={styles['card-container']}>
        <RecipeCard
    href='https://github.com/nekonee'
    thumbnail='https://i.imgur.com/VkHTicg.jpg'
    title='Fluffy pancakes'
    time='0:30'
    servings='3-5'
    likeCallback={() => alert('You added Fluffy pancakes to favourites')}
    />

    <RecipeCard
    href='https://github.com/nekonee'
    thumbnail='https://i.imgur.com/0308iuN.jpg'
    title='Cupcakes'
    time='1:30'
    servings='4-6'
    likeCallback={() => alert('You added Cupcakes to favourites')}
    />

    <RecipeCard
    href='https://github.com/nekonee'
    thumbnail='https://i.imgur.com/s9oR6BE.jpg'
    title='Macarons'
    time='2:00'
    servings='7-10'
    likeCallback={() => alert('You added Macarons to favourites')}
    />
    </div>



            <header className="App-header">
                <img src={logo} className="App-logo" alt="logo" />
            </header>






    </div>
);
}




export default App;
